  return (
    <div className="App">
        <nav>
            <h1 className={"fitness-header"}>
                Anywhere Fitness
            </h1>
            <di>
                <Link to="/">Home</Link>
                <Link to="/">About</Link>
            </di>

        </nav>

<ClientForm/>
    </div>
  );
}

export default App;
